import React from 'react';
import logo from './logo.svg';
import './App.css';
import Coursesale from './Coursesale'

function App() {
  return (
    <div className="App">
      <div className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </div>
     <Coursesale />

    </div>
  );
}

export default App;
